import { useEffect, useState } from 'react'
export default function GetAllPosts() {
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch('/test')
            .then(res => res.json())
            .then(res => setData(res.message));
    }, []);

    return (
        <div className='content'>
            <h3>all</h3>
            
        </div>
    )
}
